import React, { useState, useEffect } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'; // Import Bootstrap CSS

const StaffList = () => {
  const [staff, setStaffMembers] = useState([]);

  useEffect(() => {
    fetch('http://127.0.0.1:3010/getdocdtls')
      .then(response => response.json())
      .then(data => {
        console.log(data);
        setStaffMembers(data);
      })
      .catch(error => {
        console.error('Error:', error);
        fetch('http://127.0.0.1:3010/getdocdtls')
          .then(response => response.text())
          .then(text => console.error('Response:', text))
          .catch(error => console.error('Error fetching response:', error));
      });
  }, []);

  return (
    <div className="container mt-4"> {/* Bootstrap container class */}
      <h2>Staff Members</h2>
      <div className="table-responsive"> {/* Bootstrap responsive table */}
        <table className="table table-bordered">
          <thead className="thead-light"> {/* Bootstrap light-colored header */}
            <tr>
              <th>Name</th>
              <th>Date of Birth</th>
              <th>Degree Type</th>
              <th>Created Timestamp</th>
            </tr>
          </thead>
          <tbody>
            {staff.map((member, index) => (
              <tr key={index}>
                <td>{member.first_name} {member.last_name}</td>
                <td>{new Date(member.dob).toLocaleDateString()}</td>
                <td>{member.degree_type}</td>
                <td>{new Date(member.creat_timestamp).toLocaleString()}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default StaffList;
